import React from 'react';
import Navbar from './templates/Navbar'
import {Route, Switch, BrowserRouter} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" component={Navbar}
        />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
